#define z__RecordX(...)\
    struct {\
        z__PRIV__Record__createMembers_redirect(__VA_ARGS__)\
    }

/**
 * Create a Record Type
 * @Name: Type Name.
 * @... : Record Members
 *  a. Each Field = (typename, member_1, member_2, ... member_n)
 *  b. (typename, (NUMBER, member_1 ... member_n)) => Creates a Bitfield
 *      i. (typename, (N, member_1), :0, (N, member_1, member_2))
 *          => Different/Varied 
 */
#define z__Record(Name, ...)\
    typedef struct Name {\
        z__PRIV__Record__createMembers_redirect(__VA_ARGS__)\
    } Name\

/**
 * Call Record
 */
//#define record struct

/**
 * Assignment directly onto a Record.
 */
#define z__Record_assign(re, ...) z__PRIV__Record__assign(re, __VA_ARGS__)

/**
 * Create Reffrences from the structs.
 * e.g. :=
 *      z__Record_toReffrence(record, (y, y), (x, x))
 *      // Creates two new pointers.
 *      *x = 12;
 *      *y = 52;
 */
#define z__Record_toReffrence(record, ...) z__PRIV__Record__toReffrence(record, __VA_ARGS__)


